import React, { Component } from 'react';

// Internal Routes
import '../App.scss';

const endpoint = 'http://localhost:8080/api/bananas';

class List extends Component {
  constructor(props) {
    super(props);
    console.log('prps:', props);
  };

  componentDidMount() {
    console.log('did mount props:', props);
  }


render() {
  return (
    <div className="app-body">
      <div className="container">
          <div className="employees">
            <div className="header">
              <h2>Listing Employees {this.props.category}</h2>
            </div>
            {
              this.props.allEmployees.length > 0 ? (
                this.props.allEmployees.map(employee => {
                  return (
                    <div>Hi there! This should be a list of employees</div>
                  )
                })
              ) :
              (<div className="employees">
                <h4> There are no employees</h4>
              </div>)
            }
            </div>
        </div>
      </div>
    );
  }
}

export default List;
